import React from 'react';
import { PlusOutlined } from '@ant-design/icons';
const Room = () => {

    return (
        <div>

        <div className="messageTitle" style={{height: "50px", borderBottom: "solid thin #EFEEF5"}}>
            <div style={{maxWidth: "600px", display:"flex", alignItems: "center"}}>
                <div style={{flexGrow:"1", display:"flex", alignItems: "center"}}>
                    <h2 style={{margin:"0"}}>&nbsp;&nbsp;Messages</h2>
                </div>
                <div style={{display:"flex"}}>
                <PlusOutlined style={{justifyContent:"center", alignItems:"center"}}/>
                </div>
            </div>
        </div>

        <div style={{clear:"both"}}>
        <h1>Send a message, get a message</h1>
        <p>Direct Messages are private conversations between you and other people on Twitter. Share Tweets, media, and more!</p>
        </div>

        </div>
    );
}

export default Room;
